          <input name='cpf' type='text' maxLength='11' required>CPF</input>
          <input name='adress' type='text' maxLength='200' required>Endere√ßo</input>
          <input name='city' type='text' maxLength='28' required>Cidade</input>
          <input name='state' required>Estado</input>
          <input name='adressType' type='radio'>Apartamento</input>
        </fieldset>
      </div>
    )
  }
}
